Описание:
Дизайн ArtLine, Объем духовки 49 л, 3 уровня противней; 20 режимов, более 100 автоматических программ; Режимы «Конвекция +», «Конвекция с паром», «Автоматика жарения»; Функция «Crisp» для образования хрустящей корочки; Регулировка температуры в диапазоне от 30°С до 300°С; Банк рекомендуемых температур для каждого режима; Сенсорное управление M Touch с возможностью перелистывания/прокрутки, часы, таймер, программирование продолжительности приготовления с автоматическим отключением; Дверца со стеклом CleanGlass; Пара телескопических направляющих FlexiClip; Беспроводной термощуп; Пиролиз; Катализатор AirClean; Система охлаждения; Холодный фронт; 
Страна-производитель: Германия, гарантия 2 года.
